text:
도재정이 한 브랜드에 셀럽으로 같이 간 것도 아니고 각각 브랜드 앰버서더로 따로 간건데 이따위로 다 합쳐서 준다고요? 아니 심지어 재현이는 캔겟츄 필름 비하인드가 대부분임.. 정우는 저때 일정도 많았는데 저게 끝이고 쇼 준비하는 과정조차 없음..?
짧더라도 한명씩 따로 주는 게 맞지;;
개인것도 따로 줄꺼죠..??;; 나 진짜 어이가 없어
이걸 3개월을 편집했다는게 제일 놀라움;;

아니 각 브랜드별로 따로 줘야죠 장난하세요?
몇개월 기다린 결과가 이겁니까? 
필요할때만 도재정 붙여놓고 평소에는 챙겨주지도 않으면서;;

아 달콤해 도재정 밀라노 영상 드디어 뜨다 .. ✨

이걸 이제야 주네 모쪼록 더 내놓도록
사죄는 도재정 컴백으로 갚았으면 함 ;;
